Keybinding: ^ This is one of my favorite actions, it only works for syntax node selection modes. This replaces the parent node of the current node, with the current node. For example, with the following Rust code: fn main() { if x > 0 { println!("hello") } else { panic!(); }
} Assuming the current selection is println!("hello") and the current selection mode is Syntax Node (Coarse) , pressing ^ results in the following: fn main() { println!("hello")
} Notes: Raise works not only for if-else expressions, it works for any syntax node Raise should never cause syntax error (if it does that's a bug) Raise preserve the node type of the current node

