Since exchange works with every core movement, it can be used with Jump and Syntax Node (Coarse) to swap two distant expressions. For example, using the following Rust code: if x > 0 { println!("Yes")
}
else { x += 1; println!("no")
} ...we can swap the body of the if-else expression by: Set selection mode to Synax Tree (Coarse) by pressing s Jump to the body of if by pressing f {, then press the letter that appears on top of the first {. Enter Exchange submode by pressing x Press f {, then press the letter that appears on top of the second { Done
